import React from "react";
const Style = {
    boxSizing: "content-box",
    background: "white",
    width: "26%",
    maxWidth: "300px",
    height: " 50%",
    padding: "2rem",
    borderRadius: "5px 10px",
    top: "50%",
    position: "absolute",
    boxShadow: "rgba(0, 0, 0, 0.24) 0px 3px 8px",
    left: "50%",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    textAlign: "center",

}

export default class Login extends React.Component {

    render() {

        return (
            <div style={Style}>
                <p className="topic">ورود</p>
                <input
                    label="نام کاربری" />
                <input
                    label="رمزعبور" />
            </div>

        )
    }
}
